import React from "react";
import "./Navbar.css";
import Logo from "../Images/Logo.svg";
import {Links} from "../data";
import {useState} from "react";

import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";

import Nav from "react-bootstrap/Nav";
import Button from "react-bootstrap/Button";

const NavigationBar = () => {
  const [open, setOpen] = useState(false);
  return (
    <Navbar bg='light' expand='lg' className='sticky-nav'>
      <Container className='py-2 sticky-nav'>
        <Navbar.Brand href='/'>
          <img src={Logo} alt='Meeco' width={200} />
        </Navbar.Brand>

        <Navbar.Toggle
          onClick={() => setOpen(!open)}
          aria-controls='navbarScroll'
          aria-expanded={open}
        />
        <div style={{minHeight: "150px"}}>
          <Navbar.Collapse in={open} dimension='width'>
            <Nav
              id='navbarScroll'
              className='m-auto my-2 my-lg-0'
              style={{maxHeight: "100px"}}
              navbarScroll
            >
              {Links.map(({name, path}, index) => {
                return (
                  <li key={index}>
                    <Nav.Link
                      style={{fontWeight: 500, fontSize: 18}}
                      className='justify-content-center px-3'
                      href={path}
                    >
                      {name}
                    </Nav.Link>
                  </li>
                );
              })}
            </Nav>
            <Button
              variant='outiline-color-light'
              className='second-button mr-4'
              type='submit'
              onClick={"submit"}
            >
              <i class='fa-sharp fa-solid fa-magnifying-glass'></i>
            </Button>

            <Button className='button'>Get in Touch</Button>
          </Navbar.Collapse>
        </div>
      </Container>
    </Navbar>
  );
};
export default NavigationBar;
